import "./about.css";

const About = () => {
  return (
    <div className="a">
      <div className="a-left">
        <div className="a-card"></div>
        <div className="a-card">
          <img src="" alt="" className="a-img" />
        </div>
      </div>
      <div className="a-right"></div>
    </div>
  );
};

export default About;
